// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ItemListComponent from './components/ItemListComponent';
import CreateItemComponent from './components/CreateItemComponent';

function App() {
  return (
    <div>
      <Router>
        <div className="container">
          <Switch>
            <Route path="/" exact component={ItemListComponent}></Route>
            <Route path="/items" component={ItemListComponent}></Route>
            <Route path="/add-item/:id" component={CreateItemComponent}></Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
